import React from "react";
import siteLogo from '../../images/logo.png';


const currentDate = new Date().toLocaleString('default', { month: 'long', day: 'numeric' });

function Header() {
    return (
        <header className="header">
            <div>
                <img src={siteLogo}></img>

            </div>
        </header>
    )
}

export default Header;
